import React from 'react';
import {
  EllaLogoIcon,
  EllaBrandIcon,
  ChevronRightIcon,
  ShareIcon,
  SettingsIcon,
  UserIcon,
  MoreIcon,
  ProfileIcon
} from '../assets/icons';
import './Header.scss';

const Header = () => {
  return (
    <div className="header close-ella-search">
      <div className="header__left">
        <div className="header__logo-section">
          <EllaLogoIcon />
          <EllaBrandIcon />
          <div className="header__workspace-text">Workspace</div>
          <ChevronRightIcon />
        </div>
      </div>

      <div className="header__right">
        <div className="header__actions">
          <ShareIcon />
          <SettingsIcon />
          <UserIcon />
          <MoreIcon />
          <ProfileIcon />
        </div>
      </div>
    </div>
  );
};

export default Header;
